var liteCycle = window.liteCycle || {};

liteCycle.pause = function (root) {
    var data = root.data('liteCycle');
    clearTimeout(data.timer);
    data.autoRotate = false;
};

liteCycle.play = function (root) {
    if (root.length <= 1) return;
    var data = root.data('liteCycle');
    clearTimeout(data.timer);
    data.autoRotate = true;
    data.onSlideTimer(root);
};

liteCycle.next = function (root) {
    if (root.length <= 1) return;
    var data = root.data('liteCycle');
    clearTimeout(data.timer);
    data.autoRotate = false;
    var nextIndex = (data.index >= root.length) ? 1 : data.index + 1;
    data.setSlide(root, nextIndex, false);
};

liteCycle.previous = function (root) {
    if (root.length <= 1) return;
    var data = root.data('liteCycle');
    clearTimeout(data.timer);
    data.autoRotate = false;
    var prevIndex = (data.index <= 1) ? root.length : data.index - 1;
    data.setSlide(root, prevIndex, true);
};

